Mongo Query - Checks Collection - Static:
db.ChecksCollections.aggregate([
    {
        $match: {
            "LOCATION_ROLE": "CSI_LOC_EDA_110830_ETA-DDA_TIFF-1-CHK",
            "CSI_MAPPED_FIELDS.RCRD_CLS_CD": { $exists: false },
            "CSI_MAPPED_FIELDS.CNTRY_CD": "US"
        }
    },
    {
        $group: {
            _id: null,
            MIN_DATE: { $min: "$CSI_MAPPED_FIELDS.DOC_DT" },
            MAX_DATE: { $max: "$CSI_MAPPED_FIELDS.DOC_DT" },
            TOTAL_DOCUMENT_COUNT: { $sum: 1 }
        }
    }
]);

